import React from 'react';

export default class Schedule extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
         name:"schedule"
        }
        this.myApp=this.props.myParent;
        this.myParent=this.props.myParent;
    }
    componentWillMount() {
        let new_myChildrens = this.myParent.state.myChildrens;
        new_myChildrens["home"] = this;
        this.myParent.setState({
            myChildrens: new_myChildrens
        });

    }

    render() {
        const fthis = this;
        return (
         <div style={{
            backgroundColor: "black"
            ,color: "red"
            ,height:"150px"
        }}>
        
            </div>
        )
    }
}
